import './App.css';
import Divider from '@material-ui/core/Divider';

function Blog() {
    return (
      <div align="left">
          <Divider />
          <h1 className="blog">
            August 2021.
          </h1>
          <p>
              Moved to Pittsburgh. Excited to start grad school at Carnegie Mellon this fall!
          </p>
          <p>
              Published website. Hello world :)
          </p>
      </div>
    );
  }
  
  export default Blog;
